//nolint:revive,misspell,govet,lll,dupl,gocritic
package all

import (
	"github.com/bluenviron/gomavlib/v2/pkg/dialects/storm32"
)

// Enumeration of possible shot modes.
type MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE

const (
	// Undefined shot mode. Can be used to determine if qshots should be used or not.
	MAV_QSHOT_MODE_UNDEFINED MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_UNDEFINED
	// Start normal gimbal operation. Is usually used to return back from a shot.
	MAV_QSHOT_MODE_DEFAULT MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_DEFAULT
	// Load and keep safe gimbal position and stop stabilization.
	MAV_QSHOT_MODE_GIMBAL_RETRACT MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_GIMBAL_RETRACT
	// Load neutral gimbal position and keep it while stabilizing.
	MAV_QSHOT_MODE_GIMBAL_NEUTRAL MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_GIMBAL_NEUTRAL
	// Start mission with gimbal control.
	MAV_QSHOT_MODE_GIMBAL_MISSION MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_GIMBAL_MISSION
	// Start RC gimbal control.
	MAV_QSHOT_MODE_GIMBAL_RC_CONTROL MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_GIMBAL_RC_CONTROL
	// Start gimbal tracking the point specified by Lat, Lon, Alt.
	MAV_QSHOT_MODE_POI_TARGETING MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_POI_TARGETING
	// Start gimbal tracking the system with specified system ID.
	MAV_QSHOT_MODE_SYSID_TARGETING MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_SYSID_TARGETING
	// Start 2-point cable cam quick shot.
	MAV_QSHOT_MODE_CABLECAM_2POINT MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_CABLECAM_2POINT
	// Start gimbal tracking the home location.
	MAV_QSHOT_MODE_HOME_TARGETING MAV_QSHOT_MODE = storm32.MAV_QSHOT_MODE_HOME_TARGETING
)
